package Go2Climbmicroservices.hired_serviceservice.model.dtos;import jakarta.persistence.GeneratedValue;import jakarta.persistence.GenerationType;import jakarta.persistence.Id;import lombok.AllArgsConstructor;import lombok.Data;import lombok.NoArgsConstructor;@Data@AllArgsConstructor@NoArgsConstructorpublic class ServiceDTO {    @Id    @GeneratedValue(strategy = GenerationType.IDENTITY)    private Long id;    private Long serviceId;    private String name;    private String description;    private String location;    private int score;    private Float price;    private Float newPrice;    private String creationDate;    private String photos;    private Integer isOffer;    private Integer isPopular;}